import { Routes, Route } from "react-router-dom";


function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<Quiz />} />
      <Route path="/settings" element={<AiQuiz />} />
      <Route path="*" element={<NotFound />} />
    </Routes>
  );
}
